import React from 'react'
import { useSelector } from 'react-redux'

const Counter = () => {

  const value=useSelector((state)=>state.counter.value)

  return (
    <div>

      <button>increment</button>
      <div>{value}</div>
      <button>decrement</button>
    </div>
  )
}

export default Counter
